import '../index.css';
import DataTable from "react-data-table-component";

const Dashboard = () => {

        const columns = [
                {
                    name: 'Nome',
                    selector: row => row.title,
                },
                {
                    name: 'Data devolução',
                    selector: row => row.year,
                },
            ];
            
            const data = [
                {
                    id: 1,
                    title: 'Beetlejuice',
                    year: '1988',
                },
                {
                    id: 2,
                    title: 'Ghostbusters',
                    year: '1984',
                },
            ]
        return (
                <div className="sec__one">
                       <div ></div>
                </div>
        )
}
export default Dashboard
